import { useHistory } from "react-router";

import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export default function ProtectedRoute( props ) {

    const history = useHistory();

    const RenderSwitch = () => {
        switch ( props.path ) {
            case ( "/" ):
                props.loggedIn ?
                    history.push( "/frontpage" ) :
                    history.push( "/" )
                break

            case ( "/access" ):
                props.loggedIn ?
                    history.push( "/frontpage" ) :
                    history.push( "/access" )
                break

            case ( "/frontpage" ):
                props.loggedIn ?
                    history.push( "/frontpage" ) :
                    history.push( "/access" )
                break

            default:
                history.push( "/access" )
        }
    }

    return ( RenderSwitch() )
}
